import { Container, Content, Project } from "./styles";
import ios from '../../assets/ios.gif'


export function Projects(){
    return(
        <Container>
            <Content>
                <h1>get into it!</h1>   

                <Project>
                    <img src={ios} alt="ios app gif" />
                </Project>   
            </Content>
        </Container>
    )
}
